import React from "react";
import './Project.css';
function Project(){
    return(
        <div>
            <h3>Projects</h3>
            <table>
                <tr>
                    <td><h3>CareerVista-Hub</h3></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><input type="submit" value="Public" id="q"/></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                <td><b>JavaScript</b></td>
                </tr>
                <tr>
                    <td><h3>India-Wanderlust-Adventure</h3></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><input type="submit" value="Public" id="q"/></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><b>JavaScript</b></td>
                </tr>
                <tr>
                    <td><h3>XO_Challenge</h3></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><input type="submit" value="Public" id="q"/></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><b>JavaScript</b></td>
                </tr>
                <tr>
                    <td><h3>QR-Code-Generator</h3></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><input type="submit" value="Public" id="q"/></td>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <td><b>JavaScript</b></td>
                </tr>
            </table>
            <h5>For more details you can check my Gitub &nbsp;&nbsp; <b id="b">Id:<a href="https://github.com/Dharshini310" id="b">Dharshini310</a></b></h5>
        </div>
    );
}
export default Project;
